import React, {Component} from "react";
import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';
import Grid from '@material-ui/core/Grid';
import Chip from '@material-ui/core/Chip';
import SelIcon from '@material-ui/icons/Done';
import TabIcon from '@material-ui/icons/Apps';
//import TrashIcon from '@material-ui/icons/Delete';

import SelectPath from './SelectPathComponent';
import TablePath from './TablePathComponent';
import RestPath from './RestPathComponent';
//console.log("Inside PathComponent.")

const styles = theme => ({
    root: {
        flexGrow: 1,
    },
    paper: {
        padding: theme.spacing.unit * 2,
        textAlign: 'left',
    },
    paperImage: {
        textAlign: 'center',
        padding: theme.spacing.unit * 2,
    },
    selectchip: {
        margin: theme.spacing.unit,
	cursor: "pointer",
        color:"red",
        borderColor:"blue",
    },
    tablechip: {
        margin: theme.spacing.unit,
	cursor: "pointer",
        color:"green",
        borderColor:"blue",
    },
    restchip: {
        margin: theme.spacing.unit,
	cursor: "pointer",
        color:"blue",
        borderColor:"blue",
    },
    trashchip: {
        margin: theme.spacing.unit,
	cursor: "pointer",
        color:"gray",
        borderColor:"gray",
  },
    othchip: {
        margin: theme.spacing.unit,
        color:"red",
        borderColor:"red",
  },
});
function Details(props) {
    const { classes, state } = props;
    if (state.Show.state.viewMode === state.Show.code.view.path) {
	//display: 'flex', 
	return (
		<div style={{display:'flex'}}>
		   <SelectPath classes={classes} state={state}/>
		   <TablePath  classes={classes} state={state}/>
		   <RestPath  classes={classes} state={state}/>
		   <div style={{width:'100%'}}/>
		</div>
	);
    } else {
	return (null);
    };
}
class PathComponent extends Component {
    constructor(props) {
	super(props);
	const {state} = props;
	state.React.Path=this;
    };
    showPath(state) {
	//console.log("Showing PathComponent.",JSON.stringify(state.Path));
	this.forceUpdate();
    };
    render() {
        const { classes, state } = this.props;
        return (
            <div className={classes.root}>
                <Grid container spacing={24}>
                    <Grid item xs={12}>
		       <Details classes={classes} state={state}/>
                    </Grid>
                </Grid>
            </div>
        );
    }
}

PathComponent.propTypes = {
    classes: PropTypes.object.isRequired,
};

export default withStyles(styles)(PathComponent);
